module.exports = {
  siteTitle: 'Brady Fox | A Marketer That Can Code',
  siteDescription:
    'A driven digital marketing leader with a growing record of delivering measurable impact for clients across multiple industries. ',
  siteKeywords:
    'Brady Fox, Brady, Fox, Marketing, Bluetext, washington D.C, marketing leader',
  siteUrl: 'https://bradycfox.com',
  siteLanguage: 'en_US',
  name: 'Brady Fox',
  location: 'Washington D.C',
  email: 'bradycfox@gmail.com',
  socialMedia: [
    {
      name: 'Github',
      url: 'https://github.com/theBoxed'
    },
    {
      name: 'Linkedin',
      url: 'https://www.linkedin.com/in/bradycfox/'
    }
  ],

  headerHeight: 90,

  srConfig: (delay = 150) => {
    return {
      origin: 'bottom',
      distance: '20px',
      duration: 500,
      delay,
      rotate: { x: 0, y: 0, z: 0 },
      opacity: 0,
      scale: 1,
      easing: 'cubic-bezier(0.645, 0.045, 0.355, 1)',
      mobile: true,
      reset: false,
      useDelay: 'always',
      viewFactor: 0.25,
      viewOffset: { top: 0, right: 0, bottom: 0, left: 0 }
    };
  }
};
